{"language":"Solidity","sources":{"ProofOfWorkout.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ProofOfWorkoutWithLocation {
    struct Workout {
        uint256 id;
        address user;
        string workoutType;    // e.g., "Chest", "Yoga", etc.
        uint256 duration;      // Duration in seconds
        uint256 startTime;     // Start time of workout (UNIX timestamp)
        uint256 endTime;       // End time of workout (UNIX timestamp)
        uint256 latitudeStart; // Start Latitude (multiplied by 10^6 for precision)
        uint256 longitudeStart;// Start Longitude (multiplied by 10^6 for precision)
        uint256 latitudeEnd;   // End Latitude (multiplied by 10^6 for precision)
        uint256 longitudeEnd;  // End Longitude (multiplied by 10^6 for precision)
    }

    mapping(address => Workout[]) private workouts;
    uint256 public workoutCount;

    event WorkoutLogged(
        uint256 indexed id, 
        address indexed user, 
        string workoutType, 
        uint256 duration, 
        uint256 startTime, 
        uint256 endTime, 
        uint256 latitudeStart, 
        uint256 longitudeStart, 
        uint256 latitudeEnd, 
        uint256 longitudeEnd
    );

    // Function to log a new workout with location data
    function logWorkout(
        string memory _workoutType, 
        uint256 _duration, 
        uint256 _startTime, 
        uint256 _endTime, 
        uint256 _latitudeStart, 
        uint256 _longitudeStart, 
        uint256 _latitudeEnd, 
        uint256 _longitudeEnd
    ) public {
        require(bytes(_workoutType).length > 0, "Workout type cannot be empty");
        require(_duration > 0, "Duration must be greater than zero");
        require(_startTime > 0, "Start time must be valid");
        require(_endTime > _startTime, "End time must be greater than start time");

        workoutCount++;
        workouts[msg.sender].push(Workout(
            workoutCount, 
            msg.sender, 
            _workoutType, 
            _duration, 
            _startTime, 
            _endTime, 
            _latitudeStart, 
            _longitudeStart, 
            _latitudeEnd, 
            _longitudeEnd
        ));

        emit WorkoutLogged(
            workoutCount, 
            msg.sender, 
            _workoutType, 
            _duration, 
            _startTime, 
            _endTime, 
            _latitudeStart, 
            _longitudeStart, 
            _latitudeEnd, 
            _longitudeEnd
        );
    }

    // Function to retrieve workouts for a specific user
    function getUserWorkouts(address _user) public view returns (Workout[] memory) {
        return workouts[_user];
    }

    // Function to get the total number of workouts logged by a specific user
    function getUserWorkoutCount(address _user) public view returns (uint256) {
        return workouts[_user].length;
    }
}
